    LANGUAGE plpgsql
    AS $$
begin
    return query
    select t1.formid, t1.formname, t1.facilitytype, t1.facilitytypeid, t1.createddate,
           t2.userid, t2.approvedby, t2.submitdate, t2.approveddate, t2.transactionid, t2.f7
    from (
        select distinct a.formid, d.formname, b.facilitytype, b.facilitytypeid,
