    INNER JOIN 
        tbl_regl_profile d ON b.profileid = d.profileid 
    INNER JOIN 
        tblusertype c ON a.usertypeid = c.usertypeid     
    WHERE 
        a.username = p_username AND a.userpassword = p_userpassword;
END;
$$;


